import { css, StyleSheet } from 'aphrodite';

function Button(props) {
	return (
		<>
			<button className={css(style.getStartedBtn)}>Get Started For Free</button>
		</>
	)
}

const style = StyleSheet.create({
	margin: '0 auto',
});

export default Button;
